import React,{useState} from 'react';
import {AiOutlineClose, AiOutlineMenu} from 'react-icons/ai';
const Navbar = () => {
    const [nav, setNav]=useState(false)

    const handleNav=()=>{
        setNav(!nav);
    }
  return (
    <div className='bg-white flex justify-between items-center max-w-[1240px mx-auto h-24 px-4 text-1'>
        <h1 className='w-full text-3xl font-bold primary-color ml-4'>Hemant</h1>
        <ul className='hidden md:flex'>
            <li className='p-2'>Home</li>
            <li className='p-2'>About</li>
            <li className='p-2'>Skills</li>
            <li className='p-2'>Portfolio</li>
            <li className='p-2'>Contact</li>
        </ul>
      <div onClick={handleNav} className="block md:hidden">
        {nav ? <AiOutlineClose size={20}/>:<AiOutlineMenu size={20}/>}
      </div>
      <div onClick={handleNav} className={nav ? '':'fixed left-[-100%]'}>
       <ul className='text-3xl primary-color m-4'>
<li className="p-2">Home</li>
<li className="p-2">About</li>
<li className="p-2">Skills</li>
<li className="p-2">Portfolio</li>
<li className="p-2">Contact</li>
       </ul>
      </div>
    </div>
  )
}

export default Navbar
